17060	1	1	1	1	f	1	f	Il sistema nervoso è costituito dal sistema nervoso centrale (cervello e midollo spinale) e dal sistema nervoso periferico. Il cervello è l'organo del pensiero, dell'emozione, della memoria e dell'elaborazione sensoriale; serve molti aspetti della comunicazione e controlla vari sistemi e funzioni. I sensi speciali sono la vista, l'udito, il gusto e l'olfatto. Gli occhi, le orecchie, la lingua e il naso raccolgono informazioni sull'ambiente del corpo.
17061	1	1	1	1	f	1	f	Sistema Muscolo-Scheletrico
17062	1	1	1	1	f	1	f	Il sistema muscolo-scheletrico è costituito dallo scheletro umano (che comprende ossa, legamenti, tendini e cartilagine) e dai muscoli annessi. Esso conferisce al corpo la struttura di base e la capacità di movimento. Oltre al loro ruolo strutturale, le ossa più grandi del corpo contengono il midollo osseo, il sito di produzione delle cellule del sangue. Inoltre, tutte le ossa sono importanti siti di stoccaggio di calcio e fosfato. Questo sistema può essere suddiviso in sistema muscolare e sistema scheletrico.
17063	1	1	1	1	f	1	f	Sistema Circolatorio
17064	1	1	1	1	f	1	f	Il sistema circolatorio o cardiovascolare comprende il cuore e i vasi sanguigni (arterie, vene e capillari). Il cuore stimola la circolazione del sangue, che funge da "sistema di trasporto" per trasferire ossigeno, carburante, nutrienti, prodotti di scarto, cellule immunitarie e molecole di segnalazione (ad esempio, ormoni) da una parte all'altra del corpo. Il sangue è costituito da un fluido che trasporta le cellule in circolo, comprese quelle che si spostano dai tessuti ai vasi sanguigni e viceversa, oltre che alla milza e al midollo osseo.\n
17065	1	1	1	1	f	1	f	Apparato Respiratorio
17066	1	1	1	1	f	1	f	L'apparato respiratorio è costituito da naso, rinofaringe, trachea e polmoni. Apporta ossigeno dall'aria ed espelle anidride carbonica e acqua nell'aria.\n
17067	1	1	1	1	f	1	f	Apparato Digerente
17080	1	1	1	1	f	1	f	Il sistema endocrino è costituito dalle principali ghiandole endocrine: ipofisi, tiroide, surreni, pancreas, paratiroidi e gonadi, ma anche quasi tutti gli organi e i tessuti producono ormoni endocrini specifici. Gli ormoni endocrini fungono da segnali da un sistema corporeo all'altro in relazione a un'enorme varietà di condizioni, con conseguenti cambiamenti di funzione. Esiste anche il sistema esocrino.\n
17079	1	1	1	1	f	1	f	Sistema Endocrino
17078	1	1	1	1	f	1	f	La funzione principale del sistema linfatico è quella di estrarre, trasportare e metabolizzare la linfa, il liquido che si trova tra le cellule. Il sistema linfatico è molto simile al sistema circolatorio sia per la sua struttura che per la sua funzione di base (trasportare un fluido corporeo).\n
17077	1	1	1	1	f	1	f	Sistema Linfatico
17076	1	1	1	1	f	1	f	Il sistema immunitario è costituito dai globuli bianchi, dal timo, dai linfonodi e dai canali linfatici, che fanno parte del sistema linfatico. Il sistema immunitario fornisce un meccanismo che permette all'organismo di distinguere le proprie cellule e tessuti da cellule e sostanze estranee e di neutralizzare o distruggere queste ultime utilizzando proteine specializzate come anticorpi, citochine e recettori toll-like, tra le tante.\n
17075	1	1	1	1	f	1	f	Sistema Immunitario
17093	1	1	1	1	f	1	f	Tendini
17094	1	1	1	1	f	1	f	Cuore
17095	1	1	1	1	f	1	f	Arterie
17074	1	1	1	1	f	1	f	Il sistema riproduttivo è costituito dalle gonadi e dagli organi sessuali interni ed esterni. Il sistema riproduttivo produce i gameti di ciascun sesso, un meccanismo per la loro combinazione e un ambiente di nutrimento per i primi 9 mesi di sviluppo del neonato.\n
17073	1	1	1	1	f	1	f	Sistema Riproduttivo
17072	1	1	1	1	f	1	f	L'apparato urinario è costituito da reni, ureteri, vescica e uretra. Rimuove l'acqua dal sangue per produrre l'urina, che trasporta una serie di molecole di scarto, ioni e acqua in eccesso fuori dal corpo.\n
17071	1	1	1	1	f	1	f	Apparato Urinario
17070	1	1	1	1	f	1	f	Il sistema tegumentario è costituito dal rivestimento del corpo (la pelle), che comprende peli e unghie e altre strutture importanti dal punto di vista funzionale, come le ghiandole sudoripare e sebacee. La pelle fornisce contenimento, struttura e protezione ad altri organi, ma funge anche da importante interfaccia sensoriale con il mondo esterno.\n
17069	1	1	1	1	f	1	f	Apparato Tegumentario
17068	1	1	1	1	f	1	f	L'apparato digerente è costituito dalla bocca, compresi lingua e denti, dall'esofago, dallo stomaco, dall'intestino (tratto gastrointestinale, intestino tenue e crasso e retto), dal fegato, dal pancreas, dalla cistifellea e dalle ghiandole salivari. Converte gli alimenti in piccole molecole nutrizionali e non tossiche che vengono distribuite dalla circolazione a tutti i tessuti dell'organismo ed espelle i residui non utilizzati.\n
